WorkItem.Description:
If I remember correctly, such fields support was added in v0.9. In 0.9.1-1 it's broken again.
```
interface IRegression {
    "x-y": number;
}
class Regression {
    fail(): IRegression {
        return {
            "x-y": 22;
        };
    }
}
```
```
Error	140	Cannot convert '{ "x-y": number; }' to 'IRegression':
	Type '{ "x-y": number; }' is missing property '"x-y"' from type 'IRegression'.	regression.ts	6	16	regression.ts

```
